def get_players(top, region, players_dict, skipAnon):
     count = 0
     skip = 0
     while skip != top:
         query = '''{
           leaderboard{
             season(request:{leaderBoardDivision:%s}){
               players(take:100, skip:%s){
                 steamAccount{
                   isAnonymous
                   id
                   name
               }
               }}
           }
         }''' % (region, skip)
         headers = {"Authorization": f"Bearer {api_token}"}
         response = requests.post('https://api.stratz.com/graphql', json={"query": query}, headers=headers)
         data = json.loads(response.text)
         for player in data['data']['leaderboard']['season']['players']:

             if player['steamAccount']['id'] not in players_dict:
                 if skipAnon:
                      if (player['steamAccount']['isAnonymous'] is False):
                          players_dict[player['steamAccount']['id']] = player['steamAccount']['name']
                 else:
                      players_dict[player['steamAccount']['id']] = player['steamAccount']['name']
         skip += 100
     return players_dict

